" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 546px\">",
"   <div class=\"ttl\">",
"    Thumb movements",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 526px; height: 212px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The thumb is rotated 90&deg; to the other digits. Thus, abduction and adduction occur in a sagittal plane and flexion and extension occur in a coronal plane. Opposition, the action bringing the tip of the thumb in contact with the pads of the other fingers, is the most complex movement. The components of opposition are abduction and medial rotation at the carpometacarpal joint and flexion of the metacarpophalangeal joint.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Moore KL, Dalley AR. Clinically Oriented Anatomy, 5th ed, Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"    </div>",
